//  icons
import {
  FiYoutube,
  FiInstagram,
  FiGithub,
  FiDribbble,
  FiLayout,
  FiSettings,
  FiPenTool,
  FiTag,
  FiMail,
  FiMapPin,
  FiLinkedin
} from 'react-icons/fi';

// companies icons
import FreelancerBrandIcon from './assets/img/brands/freelancer.png';
import UpworkBrandIcon from './assets/img/brands/upwork.png';
import FiverBrandIcon from './assets/img/brands/fiverr.png';
import BehanceBrandIcon from './assets/img/brands/behance.png';
import DribbbleBrandIcon from './assets/img/brands/dribbble.png';

// projects images
import Project1 from './assets/img/projects/p1.webp';
import Project2 from './assets/img/projects/p2.webp';
import Project3 from './assets/img/projects/p3.webp';
import Project4 from './assets/img/projects/p4.webp';
import Project5 from './assets/img/projects/p5.webp';
import Project6 from './assets/img/projects/p6.webp';

// skills images
import SkillImg1 from './assets/img/skills/html5.png';
import SkillImg2 from './assets/img/skills/css3.png';
import SkillImg3 from './assets/img/skills/js.png';
import SkillImg4 from './assets/img/skills/reactjs.png';
import SkillImg5 from './assets/img/skills/nextjs.png';
import SkillImg6 from './assets/img/skills/nodejs.png';
import SkillImg7 from './assets/img/skills/git.png';
import SkillImg8 from './assets/img/skills/figma.png';

// testimonial images
import TestiImage1 from './assets/img/testimonials/testimonial-1.webp';
import TestiImage2 from './assets/img/testimonials/testimonial-2.webp';
import TestiImage3 from './assets/img/testimonials/testimonial-3.webp';

// navigation
export const navigation = [
  {
    name: 'Início',
    href: 'home',
  },
  {
    name: 'Sobre',
    href: 'about',
  },
  {
    name: 'Projetos',
    href: 'portfolio',
  },
  {
    name: 'Serviços',
    href: 'services',
  },
  {
    name: 'Contato',
    href: 'contact',
  },
];

// social
export const social = [
  {
    icon: <FiGithub />,
    href: 'https://github.com/ThiagoLima1996',
  },
  {
    icon: <FiLinkedin />,
    href: 'https://www.linkedin.com/in/thiago-lima-leite-30a4a5218/',
  },
];

// companies
export const brands = [
  {
    img: FreelancerBrandIcon,
    href: '',
  },
  {
    img: UpworkBrandIcon,
    href: '',
  },
  {
    img: FiverBrandIcon,
    href: '',
  },
  {
    img: BehanceBrandIcon,
    href: '',
  },
  {
    img: DribbbleBrandIcon,
    href: '',
  },
];

// projects
export const projectsData = [
  {
    id: '1',
    image: Project1,
    name: 'project name 1',
    category: 'Freelancer',
  },
  {
    id: '2',
    image: Project2,
    name: 'project name 2',
    category: 'Pessoal',
  },
  {
    id: '3',
    image: Project3,
    name: 'project name 3',
    category: 'Freelancer',
  },
  {
    id: '5',
    image: Project5,
    name: 'project name 5',
    category: 'Pessoal',
  },
  {
    id: '6',
    image: Project6,
    name: 'project name 6',
    category: 'Pessoal',
  },
];

// projects
export const projectsNav = [
  {
    name: 'all',
  },
  {
    name: 'Freelancer',
  },
  {
    name: 'Pessoal',
  },
];

// skill
export const skills = [
  {
    image: SkillImg1,
  },
  {
    image: SkillImg2,
  },
  {
    image: SkillImg3,
  },
  {
    image: SkillImg4,
  },
  {
    image: SkillImg5,
  },
  {
    image: SkillImg6,
  },
  {
    image: SkillImg7,
  },
  {
    image: SkillImg8,
  },
];

// services
export const services = [
  {
    icon: <FiLayout />,
    name: 'Desenvolvimento Web',
    description:
      'Crio sites com layout que se adapta a qualquer tipo de tela.',
  },
  {
    icon: <FiSettings />,
    name: 'Clean code',
    description:
      'Codigos limpos bem desenvolvido de facil manutenção e totalmente reaproveitaveis',
  },
  {
    icon: <FiGithub />,
    name: 'Git/GitHub',
    description:
      'Conheço as funções basicos do git.',
  },
];

// testimonials
export const testimonials = [
  {
    authorImg: TestiImage1,
    authorText:
      'Love the simplicity of the service and the prompt customer support. We can’t imagine working without it.',
    authorName: 'Olivia Doe',
    authorPosition: 'Head of Design, Google',
  },
  {
    authorImg: TestiImage2,
    authorText:
      'Love the simplicity of the service and the prompt customer support. We can’t imagine working without it.',
    authorName: 'Olivia Doe',
    authorPosition: 'Head of Design, Google',
  },
  {
    authorImg: TestiImage3,
    authorText:
      'Love the simplicity of the service and the prompt customer support. We can’t imagine working without it.',
    authorName: 'Olivia Doe',
    authorPosition: 'Head of Design, Google',
  },
];

// contact
export const contact = [
  {
    icon: <FiMail />,
    title: 'Tem alguma duvida?',
    subtitle: 'Estou aqui para ajudar',
    description: 'envie um Email para thiago.lima.leite@gmail.com',
  },
  {
    icon: <FiMapPin />,
    title: 'Localização atual',
    subtitle: 'Rio de Janeiro, duque de caxias',
    description: 'Disponivél para home office',
  },
];
